class PagpGroupCapability(TextualConvention, Integer32):
    description = "The group-capability value of an interface. Indicates the ability of the interface to aggregate together with other interfaces to form aggregate links, or agports. The value of PagpGroupCapability has no meaning except by comparison (equal or not equal) to other PagpGroupCapability values for different interfaces (ifIndex values) having the same device (pagpDeviceId). If two different interfaces on the same device have the same PagpGroupCapability, then they are capable of being aggregated into the same agport. If they have different PagpGroupCapability values, then they cannot be aggregated together. The assignment of PagpGroupCapability values to the variables which use them can be made either by the network administrator or by the managed system, depending on the variable. One easily-used and understood means of assigning PagpGroupCapability values is to use, for each interface's PagpGroupCapability, the lowest ifIndex (in numerical value) of all of the intefaces with which this interface can aggregate. The use of this technique is not required. Therefore, when examining a variable using the PagpGroupCapability, the user must not assume that the values have any meaning, other than by comparison for equality with other interfaces' values on the same device. Note also that a single managed system may utilize multiple pagpDeviceId values. PagpGroupCapability values may be compared only among those interfaces with the same pagpDeviceId values."
    status = 'current'

class PagpEthcOperationMode(TextualConvention, Integer32):
    description = 'The group-capability configuration operation mode of Fast Etherchannel on this interface: off(1) No aggregation of interfaces is allowed. manual(2) Aggregation is under control of the pagpGroupCapabilityConfiguration section; no PAgP protocol packets are sent, and any received are ignored. pagpOn(3) Aggregation is under control of the PAgP protocol. PAgP packets are sent on the interface and those received are acted upon. It is anticipated that further values of this textual convention may be defined as additional aggregation protocols are defined.'
    status = 'current'
    subtypeSpec = Integer32.subtypeSpec + ConstraintsUnion(SingleValueConstraint(1, 2, 3))
    namedValues = NamedValues(("off", 1), ("manual", 2), ("pagpOn", 3))

class PagpPortPriority(TextualConvention, Integer32):
    description = 'The priority of this interface for use as the active port of an aggregation operating in hot-standby mode. The highest numerical value indicates the most-desirable interface.'
    status = 'current'
    subtypeSpec = Integer32.subtypeSpec + ValueRangeConstraint(0, 255)

class PagpOperationMode(TextualConvention, Integer32):
    description = 'The group-capability configuration operation mode of the PAgP protocol on this interface: desirable(1) aggregation is under control of the PAgP protocol. PAgP packets are sent on the interface and those received are acted upon. If no data packets are received on the interface, then the interface is never attached to an agport and cannot be used for data. desirableSilent(2) aggregation is under control of the PAgP protocol. PAgP packets are sent on the interface and those received are acted upon. If no data packets are received on the interface, then after some timeout period, the interface is attached, by itself, to an agport and can thus be used for data transmission. automatic(3) aggregation is under control of the PAgP protocol. PAgP packets are not sent on the interface until at least one PAgP packet is received which indicates that the sender is operating in desirable or desirableSilent mode. If no data packets are received on the interface, then the interface is never attached to an agport and cannot be used for data. automaticSilent(4) aggregation is under control of the PAgP protocol. PAgP packets are not sent on the interface until at least one PAgP packet is received which indicates that the sender is operating in desirable or desirableSilent mode. If no data packets are received on the interface, then after some timeout period, the interface is attached, by itself, to an agport and can thus be used for data transmission. The value of PagpOperationMode takes effect only when the value of pagpEthcOperationMode is pagpOn(3). If pagpEthcOperationMode has any other value, the operation of the PAgP protocol is disabled.'
    status = 'current'
    subtypeSpec = Integer32.subtypeSpec + ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))
    namedValues = NamedValues(("desirable", 1), ("desirableSilent", 2), ("automatic", 3), ("automaticSilent", 4))

class PagpLearnMethod(TextualConvention, Integer32):
    description = 'Indicates the ability of this device to determine the input interface of an incoming data packet received on an aggregated interface. This serves as a request to the sending device for the use or avoidance of different means of assigning packets to the member interfaces of an aggregation. Three values are defined: physPort(1) This device claims to be unable to ignore the physical interface on which the packet is received. agPort(2) This device claims to be able to ignore the physical interface on which the packet is received. undefined(3) The learn method is unknown. This value is not allowed in some variables.'
    status = 'current'
    subtypeSpec = Integer32.subtypeSpec + ConstraintsUnion(SingleValueConstraint(1, 2, 3))
    namedValues = NamedValues(("physPort", 1), ("agPort", 2), ("undefined", 3))

