if mibBuilder.loadTexts: pagpPhysGroupCapability.setDescription('The values in pagpPhysGroupCapability indicate the aggregation capability of the underlying hardware. The speed, configuration, and status condition of the interface, e.g. ISL protocol on/off, ifOperStatus On/Off, full-/half-duplex, etc., does not affect the state of pagpPhysGroupCapability. Any number of interfaces with the same value of pagpPhysGroupCapability can be aggregated together manually.')
pagpOperGroupCapability = MibTableColumn((1, 3, 6, 1, 4, 1, 9, 9, 98, 1, 1, 1, 1, 4), PagpGroupCapability()).setMaxAccess("readonly")
