if mibBuilder.loadTexts: pagpOperGroupCapability.setDescription("This variable informs the system administrator examining the Fast Etherchannel MIB of the capabilities of the current state of the interface's hardware to form agports. The pagpOperGroupCapability values are adjusted automatically by the managed system to reflect configuration changes, such as port speed or duplex mode, which can affect the ability of an interface to join agports. pagpOperGroupCapability reflects the ability to form aggregations; it does not specify whether the interface is or is not currently a member of such an aggregation. pagpOperGroupCapability values are chosen so that no two interfaces may be aggregated unless both pagpPhysGroupCapability and pagpAdminGroupCapability permit the aggregation, as well as the current configuration of the interfaces. pagpOperGroupCapability may change dynamically, as a result of the operation of automatic configuration protocols such as PAgP, in order to prevent illegal aggregations. When the PAgP protocol is enabled, then pagpOperGroupCapability is the value of the group capability being transmitted on this interface in PAgP packets.")
pagpAdminGroupCapability = MibTableColumn((1, 3, 6, 1, 4, 1, 9, 9, 98, 1, 1, 1, 1, 5), PagpGroupCapability()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: pagpAdminGroupCapability.setStatus('current')
if mibBuilder.loadTexts: pagpAdminGroupCapability.setDescription("pagpAdminGroupCapability is used by the network administrator to control the aggregation of interfaces into agports. The default value of pagpAdminGroupCapability is equal to the value of pagpPhysGroupCapability on that same interface. A pagpAdminGroupCapability may be set to restrict which interfaces may be aggregated. Any attempt to set an pagpAdminGroupCapability value that permits two interfaces to be aggregated together that are prohibited from being aggregated by the pagpPhysGroupCapability values will be refused. A given device may place consistency requirements on pagpAdminGroupCapability values that span multiple interfaces. For example, one may be changing interfaces 1-4 from group capabilities 1, 1, 1, 1 to group capabilities 1, 1, 3, 3. The capability vector 1, 1, 3, 1 may be illegal. The managed device will refuse a request to set a value in an interface's pagpAdminGroupCapability variable if: 1) that new value would result in an illegal combination of values; and 2) the interface being set does not have its pagpEthcOperationMode variable set to off(1). The pagpEthcOperationMode variable may be used to avoid illegal combinations of pagpAdminGroupCapability values. As long as a given interface's pagpEthcOperationMode is in the off state, any value may be set in that interface's pagpAdminGroupCapability variable. In the above example, the third interface could be disabled, the 3 could be written to the third and fourth interfaces, and the third interfaces re-enabled. The operating manuals of the managed device must be consulted to determine the legality of a given combination of pagpAdminGroupCapability values.")
